import React from "react";
import Header from './header/header.js'
import Footer from "./footer/footer.js";
import { MapContainer } from "react-leaflet";


function Layout({children}){
    return(
        <div>
            <Header />
                
                <main>
                 <div>   
                    <MapContainer />
                 </div>
                    {children}
                    
                </main>
            
                <Footer  />
                
        </div>
    )
}
export default Layout
